UltraPanAudioProcessorEditor::UltraPanAudioProcessorEditor (UltraPanAudioProcessor& p)
    : AudioProcessorEditor(&p), processor(p), ins(processor.getTotalNumInputChannels()), outs(processor.getTotalNumOutputChannels())
{
    //[Constructor_pre] You can add your own custom stuff here..
    //[/Constructor_pre]

    addAndMakeVisible (tabs = new TabbedComponent (TabbedButtonBar::TabsAtRight));
    tabs->setTabBarDepth (25);
    tabs->addTab (TRANS("Main"), Colour (0x8900bcd1), new MainTab (processor), true);
    tabs->addTab (TRANS("Config"), Colour (0x8900bcd1), new SetupTab (processor), true);
    tabs->addTab (TRANS("Osc"), Colour (0x8900bcd1), new OscTab (processor), true);
    tabs->setCurrentTabIndex (0);

    addAndMakeVisible (bypassButton = new ToggleButton ("Bypass Button"));
    bypassButton->setButtonText (TRANS("bypass"));
    bypassButton->addListener (this);
    bypassButton->setColour (ToggleButton::textColourId, Colour (0xfff4efe7));

    addAndMakeVisible (imageButton = new ImageButton ("new button"));
    imageButton->addListener (this);

    imageButton->setImages (false, true, true,
                            ImageCache::getFromMemory (logoTypeblue_png, logoTypeblue_pngSize), 1.000f, Colour (0x00000000),
                            Image(), 1.000f, Colour (0x00000000),
                            Image(), 1.000f, Colour (0x00000000));
    addAndMakeVisible (infoOverlay = new Info());
    infoOverlay->setName ("infoOverlay");

    cachedImage_background3_png_1 = ImageCache::getFromMemory (background3_png, background3_pngSize);

    //[UserPreSize]
	infoOverlay->setVisible(false);
    //[/UserPreSize]

    setSize (600, 400);


    //[Constructor] You can add your own custom stuff here..

	sourcePos.resize(ins);
	speakerPos.resize(outs);

	setLookAndFeel(&myLookAndFeel);

	mainTab = static_cast<MainTab*>(tabs->getTabContentComponent(0));
	setupTab = static_cast<SetupTab*>(tabs->getTabContentComponent(1));
	oscTab = static_cast<OscTab*>(tabs->getTabContentComponent(2));

	sourceDraw.resize(ins);
	speakerDraw.resize(outs);

//	jassert(isPositiveAndNotGreaterThan(sourceDraw.size(), processor.getTotalNumInputChannels()));
//	jassert(isPositiveAndNotGreaterThan(speakerDraw.size(), processor.getTotalNumOutputChannels()));

	for (int in = 0; in < sourceDraw.size(); in++) {
		sourceDraw[in].setBases(410, 260);
		sourceDraw[in].setScale(2.2, 2.2);
		sourceDraw[in].setMaxAndMinValues(sliderRange,
										  -sliderRange,
										  sliderRange,
										  -sliderRange,
										  sliderRange,
										  -sliderRange);
		sourceDraw[in].setRadius(15);
		if (in == 0)
			sourceDraw[in].setColour((Colours::red).withAlpha(0.5f));
		if (in == 1)
			sourceDraw[in].setColour((Colours::blue).withAlpha(0.5f));
	}

	for (int out = 0; out < speakerDraw.size(); out++) {
		speakerDraw[out].setBases(410, 260);
		speakerDraw[out].setScale(2.2, 2.2);
		speakerDraw[out].setMaxAndMinValues(sliderRange,
										   -sliderRange,
										   sliderRange,
										   -sliderRange,
										   sliderRange,
										   -sliderRange);
		speakerDraw[out].setRadius(10);
		speakerDraw[out].setColour(Colour (0xff00BCD1));
	}

	update();

	startTimer(50);
    //[/Constructor]
}

