void UltraPanAudioProcessorEditor::paint (Graphics& g)
{
    //[UserPrePaint] Add your own custom painting code here..
    //[/UserPrePaint]

    g.fillAll (Colour (0xff232323));

    g.setColour (Colours::black);
    g.drawImageWithin (cachedImage_background3_png_1,
                       0, 0, 600, 400,
                       RectanglePlacement::centred | RectanglePlacement::onlyReduceInSize,
                       false);

    g.setColour (Colour (0xff232323));
    g.setFont (Font ("Futura-Light", 60.10f, Font::plain));
    g.drawText (TRANS("UltraPan"),
                -16, 9, 283, 81,
                Justification::centred, true);

    g.setColour (Colour (0xfff3efe7));
    g.setFont (Font ("Futura-Light", 60.10f, Font::plain));
    g.drawText (TRANS("UltraPan"),
                -17, 8, 283, 81,
                Justification::centred, true);

    g.setColour (Colour (0xff232323));
    g.setFont (Font ("Futura-Light", 12.00f, Font::plain));
    g.drawText (TRANS("JuanSaudio"),
                152, 59, 77, 27,
                Justification::centred, true);

    g.setColour (Colour (0xfff3efe7));
    g.setFont (Font ("Futura-Light", 12.00f, Font::plain));
    g.drawText (TRANS("JuanSaudio"),
                152, 59, 76, 27,
                Justification::centred, true);

    //[UserPaint] Add your own custom painting code here..

	//DrawSphere XD

	for (int in = 0; in < sourceDraw.size(); in++){
		sourceDraw[in].drawCoordSphere(g,
									   sourcePos[in].x,
									   sourcePos[in].y,
									   sourcePos[in].z);
	}

	for (int out = 0; out < speakerDraw.size(); out++) {
		speakerDraw[out].drawCoordSphere(g,
										 speakerPos[out].x,
										 speakerPos[out].y,
										 speakerPos[out].z);
	}

    //[/UserPaint]
}

